import { useState } from "react";
import Layout from "../components/layout/layout";

function Dashboard() {
  const [tab, setTab] = useState(null);
  const position = { topbar: "flex gap-5" };
  const design = { topbar: "font-medium" };

  return (
    <Layout>
      <div className={`${position.topbar} ${design.topbar}`}>
        {["Profile", "Inbox", "Orders", "Favourites", "Settings"].map(
          (item) => (
            <p
              key={item}
              className={tab === item ? "text-gray-500" : ""}
              onClick={() => setTab(item === tab && item)}
            >
              {item}
            </p>
          ),
        )}
      </div>
    </Layout>
  );
}

export default Dashboard;
